import React from 'react'
import { Summary } from '../Summary'

type Props = {
    order: any[],
    cart: any[]
}

export const OrderSummary = (props: Props) => {
  return (
    <Summary>
        <div className='h-[400px]'>
            <h1 className="font-medium py-5">Order Summary</h1>

            <section>
                {props.cart && props.order ? props.cart.map((item) => {
                    return props.order.map(id => id === item.id)
                }) : null}
            </section>
        </div>
    </Summary>
  )
}
